html.css:
.sg-b-p {
    left: 0%; 
    min-height: 320px;
    right: 0%;
  	padding: 35px 0px;
  	top: 0px;
}

.sg-b-f.sg-b-bar {
    margin: 80px 15px;
    width: 280px !important;
    right: 0 !important;
    left: auto !important;
    border-radius: 8px;
    padding: 5px 8px 16px 16px;
    border: 1px solid #e9e9e9;
    box-shadow: 0 4px 32px 0 rgba(0, 0, 0, 0.08);
    transition: all 0.4s ease;
    color: #656565;
    font-family: Tahoma, sans-serif;
    background-image: url(https://i.ibb.co/c2MN1SW/OP.png);
    background-repeat: no-repeat;
    background-size: 20%;
    background-position: 195px center;
    background-color: white;
    z-index: 1000;
  	line-height: 16px;
  }

.sg-b-f p {
    text-align: left;
    margin: 11px 0;
    font-weight: bold;
    width: 180px;
    font-size: 8pt;
}

.sg-b-l-t {
    font-weight: 600;
    color: #fff !important;
    background-color: #ff9800;
    padding: 5px;
    text-decoration: none !important;
    border-radius: 3px;
  }

.sg-b-l-m {
    width: 60%;
    font-weight: 600;
    color: #fff !important;
    background-color: #FF0046;
    padding: 5px;
    text-decoration: none !important;
    border-radius: 3px;
    text-align: center;
  }

.sg-b-f {
    text-align: left;
}
